import './WhiteCard.css';

const WhiteCard = ( {item} ) => {
    return (
    <>
         <div className='card'>
         <div className='card-back'>
          <h1>{item.name}</h1>
         </div>
        </div>
       </>
    )
}
export default WhiteCard;
